window.bookSummaryJSON = "<p>The timeless original text; required listening for anyone interested in strategy. This is a work of subtlety and paradox that shows the way to a clean and aesthetic triumph. Sun Tzu insisted that a skilled warrior observes, calculates, outwits, and outmaneuvers an adversary, and in doing so averts the destruction of battle.</p> <p>Includes a soundtrack entitled \"The Mysterious Sound of Wind in the Bamboo\", a 43-minute 14-track collection of Zen-inspired Japanese music by the Matsu Take Ensemble. </p>"; 
